package com.EsportLeagueStats.ESLS.web.requests;public class AddFinaleRequest {    public int uid;    public String finaleMestoNaOdrzuvanje;    public int seid;    public int tid;    public AddFinaleRequest(int uid, String finaleMestoNaOdrzuvanje, int seid, int tid) {        this.uid = uid;        this.finaleMestoNaOdrzuvanje = finaleMestoNaOdrzuvanje;        this.seid = seid;        this.tid = tid;    }    public int getUid() {        return uid;    }    public void setUid(int uid) {        this.uid = uid;    }    public String getFinaleMestoNaOdrzuvanje() {        return finaleMestoNaOdrzuvanje;    }    public void setFinaleMestoNaOdrzuvanje(String finaleMestoNaOdrzuvanje) {        this.finaleMestoNaOdrzuvanje = finaleMestoNaOdrzuvanje;    }    public int getSeid() {        return seid;    }    public void setSeid(int seid) {        this.seid = seid;    }    public int getTid() {        return tid;    }    public void setTid(int tid) {        this.tid = tid;    }}